import React from "react";
import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div className="container">
        <div id="task-container">
          <div id="form-wrapper"></div>
          <div id="list-wrapper"></div>
        </div>
      </div>
    );
  }
}

export default App;
